import React from 'react'
import { selectAllCoupons, useGetCouponsQuery } from '../api/couponsSlice'
import { useSelector } from "react-redux"

export const CouponsList = () => {
  // const coupons = useSelector(selectAllCoupons)
  const { data:coupons, isLoading, isSuccess} = useGetCouponsQuery('getCoupons')

  let couponsList;
  if (isSuccess) {
    couponsList = coupons.ids.map(id => (
          <li key={id} value={id} className='coupon'>
              <div>{coupons.entities[id].name}</div>
              <div>{coupons.entities[id].code}</div>
          </li>
      ))
  }

  return (
    <div className='coupons'>
      <ul className='couponsList'>{couponsList}</ul>
    </div>

  )
}
